//Function Name: selMenuWai
//Input: 
//Output: None
//Description: 
//使用MetroUI.bmp来实现界面
VOID selMenuWai(VOID)
{
	UINTN x,y;
	x=METRO_FRAME_X;
	y=METRO_FRAME_Y;
	rectblock(x+METRO_NEI_SEL_X,y+METRO_NEI_SEL_Y,x+METRO_NEI_SEL_X+METRO_SEL_BLOCK_WIDTH-1,y+METRO_NEI_SEL_Y+METRO_SEL_BLOCK_HEIGHT-1,&(gMainMenuColorTable[1]));	//去除内网
	rectblock(x+METRO_WAI_SEL_X,y+METRO_WAI_SEL_Y,x+METRO_WAI_SEL_X+METRO_SEL_BLOCK_WIDTH-1,y+METRO_WAI_SEL_Y+METRO_SEL_BLOCK_HEIGHT-1,&(gMainMenuColorTable[3]));	//选择外网
	putMenuNei(x+METRO_MENU_NEI_X,y+METRO_MENU_NEI_Y,gNeiMetroColorTable,gNeiMetroPicture);
	putMenuWai(x+METRO_MENU_WAI_X,y+METRO_MENU_WAI_Y,gSelWaiMetroColorTable,gSelWaiMetroPicture); 
}
